Breaking news	\r\nMayabazar (Market of Illusions) is an Indian epic fantasy film directed by Kadiri Venkata Reddy and produced by B. Nagi Reddy and Aluri Chakrapani, first released on 27 March 1957. The film was shot in Telugu and Tamil with the same title, but with a few differences in the cast. The story is an adaptation of the folk tale Sasirekha Parinayam, which in turn is based on the epic Mahabharata. It tells the story of Krishna (N. T. Rama Rao) and Ghatotkacha (S. V. Ranga Rao), who try to reunite Arjuna's son Abhimanyu with his love, Balarama's daughter (Savitri). Though Rama Rao was initially reluctant to play the lead role, his portrayal of Krishna received acclaim and yielded more offers to reprise the same role in several unrelated films. Most of the musical score was composed by Ghantasala. Both versions of the film were critically and commercially successful. The film is considered a landmark in both Telugu and Tamil cinema, with praise for its cast and technical accomplishments, despite the limitations of the technology at the time. A May 2013 CNN-News18 poll listed Mayabazar as the greatest Indian film of all time. 	\N	\N	8
